import "./digitConverter.css"
import Header from "../../components/header/header.js"
import Footer from "../../components/footer/footer.js"
import logoImage from '../../images/DigitConverter_logo.png';
import React, { useRef } from 'react';

function DigitConverter() {
    const inputRef = useRef(null);
    const fromBaseRef = useRef(null);
    const toBaseRef = useRef(null);
    const outputRef = useRef(null);

    const Convert = () => {
        let input = inputRef.current.value;
        let f_base = fromBaseRef.current.value;
        let t_base = toBaseRef.current.value;

        let decimalNum = parseInt(input, parseInt(f_base));
        let result;

        if (t_base === "10") {
            result = decimalNum.toString();
        } else if (t_base === "8") {
            result = decimalNum.toString(8);
        } else if (t_base === "16") {
            result = decimalNum.toString(16);
        } else {
            result = decimalNum.toString(2);
        }

        outputRef.current.value = result;
    };

    return (
        <div className="digitConverter">
            {/* Import Header */}
            <div>
                { Header() }
            </div>

            <div id="logo_main">
                <p>
                    <img id="logo_image" src={logoImage} alt="Logo" />
                </p>
            </div>

            <div id="function">
                <form id="convert" autocomplete="off">
                    <div class="form-group">
                        <label for="input">Input number</label>
                        <input type="text" id="input" name="input" class="form-control form-control-lg" required autofocus />
                    </div>

                    <div class="form-group">
                        <label for="sel1">From: </label>
                        <select name="sel1" id="sel1" class="form-control">
                            <option value="2" selected>binary</option>
                            <option value="8">octal</option>
                            <option value="10">decimal</option>
                            <option value="16">hex</option>
                        </select>
                    </div>

                    <div class="form-group">
                        <label for="sel2">To: </label>
                        <select name="sel2" id="sel2" class="form-control">
                            <option value="2">binary</option>
                            <option value="8">octal</option>
                            <option value="10" selected>decimal</option>
                            <option value="16">hex</option>
                        </select>
                    </div>

                    <div class="form-group">
                        <button class="button2" type="button" title="Convert" onClick={ Convert(document.getElementById('input').value, document.getElementById('sel1').value, document.getElementById('sel2').value) }>Convert</button>
                    </div>

                    <div class="form-group">
                        <label for="output" id="output_label">Result number</label>
                        <textarea rows="2" id="output" class="form-control form-control-lg" ref={ outputRef } readonly></textarea>
                    </div>
                </form>
            </div>

            {/* Import Footer */}
            <div>
                { Footer() }
            </div>

        </div>
    );
}

export default DigitConverter;
